import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [name,setName]=useState(0);
  function Increase(){
      setName(name+5);
  }
  useEffect(()=>{
    const incre=setInterval=(()=>{
      setName(prevNumber => prevNumber + 1);
    },1000);
    return ()=> clearInterval(incre);
  },[])
  return (
    <>
        <div>
          <h1>{name}</h1>
          <button onClick={Increase}>+</button><button>-</button>
        </div>
    </>
  );
}

export default App;
